import React from 'react';
import './Login.css'

const Login = () => {
  const handleLogin = () => {
    window.location.href = '/api/auth/google'; // Направляем на Google OAuth
  };

  return (
    <div className="login">
      <h2>Login</h2>
      <button onClick={handleLogin} className="login-button">
        Login with Google
      </button>
    </div>
  );
};

export default Login;
